import axios from "axios";

const fetchQuotes = async () => {
  const apiUrl = "https://type.fit/api/quotes";

  try {
    const response = await axios.get(apiUrl);
    return response.data;
  } catch (error) {
    throw error;
  }
};

export default fetchQuotes;
